Texto:
Luva de Pedreiro zerou todo perfil do Instagram e mencionou que após trabalhos com os patrocinadores, não faria mais conteúdo… temos 3 opções:

- Jogada de marketing;
- Não quer mais mesmo;
- Problemas psicológicos;

Eu fico com a terceira opção. A cabeça é foda!

Texto_Traduz:
Luva de Pedreiro zeroed every Instagram profile and mentioned that after working with the sponsors, he would not make more content… we have 3 options:

- Marketing ploy;
- You don't want it anymore;
- Psychological problems;

I go with the third option. The head sucks!
